import "./topbar.scss";
import React from "react";
//import {Person} from "@material-ui";

class Topbar extends React.Component {
  constructor() {
    super();

    this.state = {
      sandwich: "OFF",
    };
  }

  handleClick = () => {
    if (this.state.sandwich == "OFF") {
      this.setState({
        sandwich: "ON",
      });
    } else {
      this.setState({
        sandwich: "OFF",
      });
    }
  };

  render() {
    let temp = "topbar";
    if (this.state.sandwich === "ON") {
      temp += " active";
    }
    return (
      <div className={temp}>
        <div className="wrapper">
          <p className="gauche">
            <a href="#" className="logo">
              Anthony Bauchet
            </a>
            <div className="itemContainer">
              <p>anthony.luu@outlook.fr</p>
            </div>
            <div className="itemContainer">
              <p>06 6666666666</p>
            </div>
            
            <span className="menu">
              <div className="itemContainer">
                <p>Pr√©sentation</p>
              </div>
              <div className="itemContainer">
                <p>Projets</p>
              </div>
              <div className="itemContainer">
                <p>Contact</p>
              </div>
            </span>
          </p>

          <p className="droite">
            <div className="sandwich" onClick={this.handleClick}>
              <span className="line1"></span>
              <span className="line2"></span>
              <span className="line3"></span>
            </div>
          </p>
        </div>
      </div>
    );
  }
}

export default Topbar;

